import React from "react";
import './Rating.css'
import {ReactComponent as StarGrey} from '../../assets/starGrey.svg'
import {ReactComponent as StarPink} from '../../assets/starPink.svg'
import data from '../../json/housing.json'

export default function Rating({rating}){
    return (
        <div className="rating">
            {[Array(rating)].map((e, i) => <StarPink key={i}/>)}
            {[Array(5-rating)].map((e, i) => <StarGrey key={i}/>)}
        </div>
    )
}
